gat.alphabet = {}

gat.alphabet.tools = {

  _addOpentypeFontToMyAlphabet: function(font, fontName, callback){

    function opentypePathToMyPath(path){
      let newPath = Array(path.commands.length)
      for(let i in path.commands){
        let node = path.commands[i]
        if(node.type == "M"){
          newPath[i] = ["M",node.x,node.y]
        } else if(node.type == "L"){
          newPath[i] = ["L",node.x,node.y]
        } else if(node.type == "Q"){
          newPath[i] = ["Q",node.x1,node.y1,node.x,node.y]
        } else if(node.type == "Z"){
          newPath[i] = ["Z"]
        } else if(node.type == "C"){
          newPath[i] = ["C",node.x1,node.y1,node.x2,node.y2,node.x,node.y]
        }
      }
      return newPath
    }

    function opentypeTextlineToPath(font, text){
      let opentypePath = font.getPath(text, 17, 17, 50);
      let bbox = opentypePath.getBoundingBox()
      bbox = [bbox.x1, bbox.y1, bbox.x2, bbox.y2]
      let myPath = opentypePathToMyPath(opentypePath)
      return {
        path:myPath,
        width:bbox[2]-bbox[1]
      }
    }

    gat.alphabet[fontName] = {
      textlineToPath: opentypeTextlineToPath.bind(null,font),
      lineHeight: 50,
      availableCharacters:
        Object.keys(font.encoding.cmap.glyphIndexMap)
        .map(x => String.fromCharCode(x))
        .join("")
    }

    callback()
  },

  loadOpentypeFontFromUrl: function(fontUrl, fontName, callback){
    opentype.load(fontUrl, function(err, font){
      if (err) {
           alert('Font could not be loaded: ' + err);
      } else {
        gat.alphabet.tools._addOpentypeFontToMyAlphabet(font, fontName, callback)
      }
    })
  },

  loadOpentypeFontFromArrayBuffer: function(arrayBuffer, fontName, callback){
    let font = opentype.parse(arrayBuffer)
    gat.alphabet.tools._addOpentypeFontToMyAlphabet(font, fontName, callback)
  },

}

