    let path = []
    let width = 0
    path = path.concat([["M",0,25]])
    for(let i=0; i<text.length; i++){
      let c = text[i];
      if(gat.alphabet.my_connected[c] == undefined) continue;
      let char_pathWidth = gat.alphabet.my_connected[c]()
      path = path.concat(gat.path.getPath(char_pathWidth.path,[width,25],[1,-1]))
      width += char_pathWidth.width
    }
    return {
      path:path,
      width:width
    }
